package testCases;

import org.apache.pdfbox.pdmodel.PDDocument;
import org.apache.pdfbox.pdmodel.PDDocumentInformation;
import org.apache.pdfbox.pdmodel.PDPage;
import org.apache.pdfbox.pdmodel.PDPageContentStream;
import org.apache.pdfbox.pdmodel.common.PDRectangle;
import org.apache.pdfbox.pdmodel.font.PDType1Font;
import org.apache.pdfbox.pdmodel.graphics.image.PDImageXObject;

import java.io.FileOutputStream;
import java.io.IOException;
import java.io.OutputStream;
import java.util.Base64;
import java.util.Calendar;

public class PDFGenerator {
	
	private static float addTextToPage(PDDocument document, PDPageContentStream contentStream, String text, float startX, float startY, float maxWidth) throws IOException {
        contentStream.setFont(PDType1Font.HELVETICA, 12);

        // Calculate text width to prevent overflow
        float textWidth = PDType1Font.HELVETICA.getStringWidth(text) / 1000f * 12; // Font size 12

        if (textWidth > maxWidth) {
            throw new IllegalArgumentException("Text too wide for the available width");
        }

        contentStream.beginText();
        contentStream.newLineAtOffset(startX, startY);
        contentStream.showText(text);
        contentStream.endText();

        return startY - 12 - 12; // Update the Y position for the next element
    }
	
	private static float addImageToPage(PDDocument document, PDPageContentStream contentStream, String imageBase64, float startX, float startY, float maxWidth, float maxHeight) throws IOException {
        // Convert base64 image to PDImageXObject
        PDImageXObject image = PDImageXObject.createFromByteArray(document, Base64.getDecoder().decode(imageBase64), "Image");

        float imageWidth = image.getWidth();
        float imageHeight = image.getHeight();

        if (imageWidth > maxWidth || imageHeight > maxHeight) {
            float scaleFactor = Math.min(maxWidth / imageWidth, maxHeight / imageHeight);
            imageWidth *= scaleFactor;
            imageHeight *= scaleFactor;
        }

        contentStream.drawImage(image, startX, startY - imageHeight, imageWidth, imageHeight);

        return startY - imageHeight - 12; // Update the Y position for the next element
    }
	

    public static void main(String[] args) {
    	
    	try {
            PDDocument document = new PDDocument();
            PDPage page = new PDPage(PDRectangle.A4);
            document.addPage(page);

            try (PDPageContentStream contentStream = new PDPageContentStream(document, page)) {
                float currentY = PDRectangle.A4.getHeight() - 50; // Starting Y position

                currentY = addTextToPage(document, contentStream, "First Text", 50, currentY, PDRectangle.A4.getWidth() - 100);
                currentY = addImageToPage(document, contentStream, ""
                		, 50, currentY, PDRectangle.A4.getWidth() - 100, 200);

                currentY = addTextToPage(document, contentStream, "Second Text", 50, currentY, PDRectangle.A4.getWidth() - 100);
                currentY = addImageToPage(document, contentStream, ""
                		, 50, currentY, PDRectangle.A4.getWidth() - 100, 200);
            }

            try (OutputStream outputStream = new FileOutputStream("output.pdf")) {
                document.save(outputStream);
            }

            document.close();
        } catch (IOException e) {
            e.printStackTrace();
        }
    	
    
        System.out.println("Done");
    }

    
}
